(31, 1, '2021-01-07 05:44:48', '2021-01-07 05:44:48', 'Bộ bàn ghế Hàn Quốc ZENA phù hợp cho phòng ăn, khu vực tiếp khách.\r\n\r\nBộ bàn thiết kế theo tông trầm ấm.\r\n\r\nMang đến không gian sống hiện đại – sang trọng.\r\n\r\nMẫu nội thất đang được ưa chuộng tại Hàn Quốc.\r\n\r\nMàu gỗ Walnut.\r\n\r\n<img class=\"aligncenter\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/03/UP-1.jpg\" />\r\n\r\n<img class=\"aligncenter\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/03/UP-2-3-CH%E1%BB%A8NG-NH%E1%BA%ACN-CH%E1%BA%A4T-L%C6%AF%E1%BB%A2NG-SP-HANS.jpg\" width=\"847\" height=\"2316\" />\r\n<h1>BỘ BÀN GHẾ HÀN QUỐC ZENA (6 NGƯỜI)</h1>\r\n<img class=\"aligncenter size-large wp-image-9596\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/10/bo-ban-6-nguoi-595x421.png\" alt=\"bộ bàn 4 người\" width=\"595\" height=\"421\" />\r\n<h4>  Kiểu kết hợp: Bàn 1m8 + 6 ghế</h4>\r\n<h4>CHẤT LIỆU                      :   100% GỖ TỰ NHIÊN – WALNUT (NÂU ĐẬM)</h4>\r\n<h4>MÀU SẮC                        :    XANH NAVY (CB)</h4>\r\n<h4>THƯƠNG HIỆU               :    HAN’S FURNITURE</h4>\r\n<h4>PHONG CÁCH                :    HÀN QUỐC</h4>\r\n<h4>QUY CÁCH SẢN PHẨM :        BÀN                   D1350 * R800 * C740 (mm) (4~6 chỗ ngồi)</h4>\r\n<h4>                                                                            D1800 * R830 * C740 (mm) (6~8 chỗ ngồi)</h4>\r\n<h4>                                                 GHẾ                    D570 * R470 * 758 (mm)</h4>\r\n<h4>                                                 GHẾ DÀI            D1050 * R475 * 610 (mm) (2 chỗ)</h4>\r\n&nbsp;\r\n<h2>DETAIL &amp; STYLE</h2>\r\n<img class=\"aligncenter size-large wp-image-9565\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-15-595x407.png\" alt=\"bộ bàn ăn zena 15\" width=\"595\" height=\"407\" />\r\n<h4>100% Gỗ tự nhiên</h4>\r\n<img class=\"aligncenter size-large wp-image-9531\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-33-595x266.png\" alt=\"bộ bàn ăn zena 33\" width=\"595\" height=\"266\" />\r\n<h4>THIẾT KẾ CHẮC CHẮN &amp; CHỐNG THẤM NƯỚC.</h4>\r\n<img class=\"aligncenter size-large wp-image-9564\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-14-595x405.png\" alt=\"bộ bàn ăn zena 14\" width=\"595\" height=\"405\" />\r\n<h4>Góc cạnh bàn được bo tròn,</h4>\r\n<h4>AN TOÀN cho trẻ em.</h4>\r\n<img class=\"aligncenter size-large wp-image-9563\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-13-595x405.png\" alt=\"bộ bàn ăn zena 13\" width=\"595\" height=\"405\" />\r\n\r\nMặt bàn nhẵn mịn\r\n\r\n<img class=\"aligncenter size-large wp-image-9530\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-31-595x523.png\" alt=\"bộ bàn ăn zena 31\" width=\"595\" height=\"523\" />\r\n\r\n&nbsp;\r\n\r\n<img class=\"aligncenter size-large wp-image-9521\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-12-595x358.png\" alt=\"bộ bàn ăn zena 12\" width=\"595\" height=\"358\" />\r\n<h4>Ghế ZENA được thiết kế sang trọng, đơn giản.</h4>\r\n<img class=\"aligncenter size-large wp-image-9533\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-39-595x397.png\" alt=\"bộ bàn ăn zena 39\" width=\"595\" height=\"397\" />\r\n<h4>Với thiết kế lưng uốn cong tạo thẩm mỹ cho bộ ghế, giúp bạn ngồi lâu vẫn thoải mái và thông thoáng.</h4>\r\n<img class=\"aligncenter size-large wp-image-9571\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-32-595x534.png\" alt=\"bộ bàn ăn zena 32\" width=\"595\" height=\"534\" />\r\n<h2> SANG TRỌNG – TINH TẾ</h2>\r\n<img class=\"aligncenter size-large wp-image-9532\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/bo-ban-an-zena-35-595x459.png\" alt=\"bộ bàn ăn zena 35\" width=\"595\" height=\"459\" />\r\n<h3>BỌC NỆM ĐẶC BIỆT</h3>\r\n<strong> chất liệu từ giả da CAO CẤP, MỀM MẠI </strong>\r\n\r\n<strong>KHÔNG THẤM NƯỚC</strong>\r\n\r\n<strong>BỀN MÀU &amp; DỄ DÀNG VỆ SINH.</strong>\r\n\r\n<img class=\"aligncenter size-large wp-image-9596\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/10/bo-ban-6-nguoi-595x421.png\" alt=\"bộ bàn 4 người\" width=\"595\" height=\"421\" />', 'Bộ Bàn Ghế Hàn Quốc ZENA', 'Tên Sản Phẩm: Bộ bàn ghế ZENA – 6 ghế\r\n\r\nKiểu kết hợp: Bàn 1m8 + 6 ghế đơn: 13.860.000 vnd\r\n\r\nBàn 1m35 + 6 ghế đơn: 12.940.000\r\n\r\nMàu nệm: Xanh Navy (CB)\r\n\r\nKích thước:\r\n\r\nBàn: 1800 x 830 x 740 mm (Dài x Rộng x Cao)\r\n\r\nGhế: 570 x 470 x 758 mm\r\n\r\nChất liệu: 100% gỗ tự nhiên, cao su loại 1\r\n\r\nBọc nệm: giả da cao cấp\r\n\r\nSản phẩm đang bán tại: Hàn Quốc, Việt Nam\r\n\r\nThương hiệu: Han’s Furniture\r\n\r\nBảo hành: 1 năm (kết cấu sản phẩm)\r\n\r\n<em>Lưu ý: Sản phẩm thực tế có thể giống hoặc đẹp hơn trên hình</em>', 'publish', 'open', 'closed', '', 'bo-ban-ghe-han-quoc-zena', '', '', '2021-01-07 05:44:49', '2021-01-07 05:44:49', '', 0, 'http://localhost/wordpress/?post_type=product&#038;p=31', 0, 'product', '', 0),
