(43, 1, '2021-01-08 14:31:22', '2021-01-08 14:31:22', '<h1>BỘ BÀN ĂN HÀN QUỐC DOLAS</h1>\r\n<img class=\"aligncenter wp-image-9155\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-2.png\" alt=\"bộ bàn ăn dolas (2)\" width=\"800\" height=\"548\" />\r\n\r\nKích thước bàn: D1350 x R780 x C740 mm\r\n\r\n<img class=\"aligncenter wp-image-9161\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-12.png\" alt=\"bộ bàn ăn dolas (12)\" width=\"800\" height=\"661\" />\r\n<h2>DETAIL</h2>\r\n<img class=\"aligncenter wp-image-9159\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-6-595x427.png\" alt=\"bộ bàn ăn dolas (6)\" width=\"800\" height=\"574\" />\r\n\r\n<img class=\"aligncenter wp-image-9156\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-3-595x389.png\" alt=\"bộ bàn ăn dolas (3)\" width=\"800\" height=\"523\" />\r\n\r\n<img class=\"aligncenter wp-image-9157\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-4-595x395.png\" alt=\"bộ bàn ăn dolas (4)\" width=\"800\" height=\"531\" />\r\n\r\n<img class=\"aligncenter wp-image-9160\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-7-595x380.png\" alt=\"bộ bàn ăn dolas (7)\" width=\"800\" height=\"511\" />\r\n\r\nKích thước ghế: D430 x R430 x C830 mm\r\n\r\n<img class=\"aligncenter wp-image-9158\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-5-595x323.png\" alt=\"bộ bàn ăn dolas (5)\" width=\"800\" height=\"434\" />\r\n\r\n<img class=\"aligncenter wp-image-9162\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-13-595x397.png\" alt=\"bộ bàn ăn dolas (13)\" width=\"800\" height=\"534\" />\r\n\r\n<img class=\"aligncenter wp-image-9154\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/08/bo-ban-an-dolas-1.png\" alt=\"bộ bàn ăn dolas (1)\" width=\"800\" height=\"995\" />\r\n\r\n<img class=\"aligncenter\" src=\"https:/