(53, 1, '2021-01-08 14:39:59', '2021-01-08 14:39:59', 'Sofa Hàn Quốc ALMA với 2 kích thước (D2180 x R800) &amp; (D2300 x R800)\r\n\r\nThiết kế phù hợp cho căn hộ chung cư và nhà phố nhỏ gọn.\r\n\r\nMàu gỗ:<em> màu gỗ tự nhiên, walnut (màu cánh gian), antique (vàng đồng).</em>\r\n\r\nBọc nệm: vải cao cấp\r\n\r\nMàu sắc: light brown\r\n<h1>SOFA HÀN QUỐC ALMA</h1>\r\n<img class=\"aligncenter wp-image-8749 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-17-595x418.png\" alt=\"sofa vải hàn quốc alma (17)\" width=\"595\" height=\"418\" />\r\n\r\nMàu sắc: Light brown\r\n\r\n<img class=\"aligncenter size-large wp-image-8759\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-27-595x397.png\" alt=\"sofa vải hàn quốc alma (27)\" width=\"595\" height=\"397\" />\r\n\r\nKhung sườn gỗ tự nhiên đã qua xử lý trơn nhẵn, không thấm nước.\r\n\r\n<img class=\"aligncenter size-large wp-image-8738\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-33-595x397.png\" alt=\"sofa vải hàn quốc alma (33)\" width=\"595\" height=\"397\" />\r\n\r\nCó thể thiết kế sofa kích thước lớn hơn tùy theo yêu cầu từ 3000 mm đến 3700*800 mm\r\n\r\n<img class=\"aligncenter size-large wp-image-8748\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-11-595x397.png\" alt=\"sofa vải hàn quốc alma (11)\" width=\"595\" height=\"397\" />\r\n\r\n<img class=\"aligncenter size-large wp-image-8739\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-34-595x397.png\" alt=\"sofa vải hàn quốc alma (34)\" width=\"595\" height=\"397\" />\r\n\r\nChất liệu vải cao cấp không thấm nước\r\n\r\n<img class=\"aligncenter size-large wp-image-8756\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-24-595x397.png\" alt=\"sofa vải hàn quốc alma (24)\" width=\"595\" height=\"397\" />\r\n\r\nChiều cao bệ ngồi của sofa: 350 mm\r\n\r\n<img class=\"aligncenter size-large wp-image-8747\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-10-595x397.png\" alt=\"sofa vải hàn quốc alma (10)\" width=\"595\" height=\"397\" />\r\n\r\n<img class=\"aligncenter size-large wp-image-8757\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-25-595x397.png\" alt=\"sofa vải hàn quốc alma (25)\" width=\"595\" height=\"397\" />\r\n\r\nChân sofa là gỗ tự nhiên chắc chắn\r\n\r\n<img class=\"aligncenter size-large wp-image-8735\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-30-595x397.png\" alt=\"sofa vải hàn quốc alma (30)\" width=\"595\" height=\"397\" />\r\n\r\nKích thước: D2180 x R800 x C550 mm\r\n\r\n<img class=\"aligncenter size-large wp-image-8758\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-26-595x397.png\" alt=\"sofa vải hàn quốc alma (26)\" width=\"595\" height=\"397\" />\r\n\r\nChân sofa vải cao 14cm\r\n\r\n<img class=\"aligncenter size-large wp-image-8750\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-18-595x397.png\" alt=\"sofa vải hàn quốc alma (18)\" width=\"595\" height=\"397\" />\r\n\r\n<img class=\"aligncenter size-large wp-image-8761\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-1-595x397.png\" alt=\"sofa vải hàn quốc alma (1)\" width=\"595\" height=\"397\" />\r\n\r\nKiểu kết hợp: Sofa vải Hàn Quốc ALMA + bàn sofa IRU 1m2\r\n\r\n<img class=\"aligncenter size-large wp-image-8762\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/07/sofa-vai-han-quoc-alma-7-595x397.png\" alt=\"sofa vải hàn quốc alma (7)\" width=\"595\" height=\"397\" />\r\n\r\n<em>LƯU Ý: Sản phẩm thực tế có thể đẹp hơn trên hình.</em>', 'Sofa Hàn Quốc ALMA-Light', 'SOFA HÀN QUỐC – ALMA\r\n\r\nThiết kế riêng theo kích thước\r\n\r\nChất liệu: 100% gỗ tự nhiên\r\n\r\nBọc nệm: vải cao cấp\r\n\r\nMàu sắc: light brown\r\n\r\nKích thước phù hợp cho thiết kế căn hộ chung cư và nhà phố.\r\n\r\nKích thước: D2180 x R800 x C550 mm – Giá  11.660.000 vnd\r\n\r\nKích thước: D2300 x R800 x C550 mm – Giá  12.100.000 vnd\r\n\r\nSản phẩm đang bán tại: Hàn Quốc, Việt Nam\r\n\r\nThương hiệu: Han’s Furniture\r\n\r\nBảo hành: 1 năm (kết cấu sản phẩm)\r\n\r\n<em>LƯU Ý: Sản phẩm thực tế có thể đẹp hơn trên hình.</em>', 'publish', 'open', 'closed', '', 'sofa-han-quoc-alma-light-brown', '', '', '2021-01-09 01:41:22', '2021-01-09 01:41:22', '', 0, 'http://localhost/wordpress/?post_type=product&#038;p=53', 0, 'product', '', 0),
