(63, 1, '2021-01-08 14:44:00', '2021-01-08 14:44:00', 'Tủ đầu giường Hàn Quốc Plus\r\n\r\nMàu sắc: màu antique sang trọng\r\n\r\nChất liệu: gỗ tự nhiên, cao su loại 1\r\n\r\nThiết kế: theo phong cách hiện đại – sang trọng\r\n<h1>TỦ ĐẦU GIƯỜNG HÀN QUỐC PLUS</h1>\r\n&nbsp;\r\n\r\n<img class=\"aligncenter wp-image-7883 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-11-595x446.png\" alt=\"tủ đầu giường 1\" width=\"595\" height=\"446\" />\r\n\r\nKích thước: D400 * R500 * C550\r\n\r\n<img class=\"aligncenter wp-image-7888 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-16-595x446.png\" alt=\"tủ đầu giường 16\" width=\"595\" height=\"446\" />\r\n\r\nChất liệu: gỗ tự nhiên, cao su loại 1\r\n\r\n<img class=\"aligncenter wp-image-7884 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-12-595x446.png\" alt=\"tủ đầu giường 12\" width=\"595\" height=\"446\" />\r\n\r\nKiểu dáng vuông vắn, góc cạnh được vuốt mịn hiện đại và sang trọng, an toàn hơn khi sử dụng\r\n\r\n<img class=\"aligncenter wp-image-7873 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-1-595x446.png\" alt=\"tủ đầu giường 1\" width=\"595\" height=\"446\" />\r\n\r\nTủ có 2 ngăn, giúp không gian lưu trữ đồ dùng tiện ích\r\n\r\n<img class=\"aligncenter wp-image-7878 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-6-595x446.png\" alt=\"tủ đầu giường 6\" width=\"595\" height=\"446\" />\r\n\r\nGóc cạnh hiện đại\r\n\r\n<img class=\"aligncenter wp-image-7877 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-5-595x446.png\" alt=\"tủ đầu giường 5\" width=\"595\" height=\"446\" />\r\n\r\nSử dụng thanh kéo cực êm, giảm tiếng ồn\r\n\r\n<img class=\"aligncenter wp-image-7889 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-10-1-595x527.png\" alt=\"tủ đầu giường 10\" width=\"595\" height=\"527\" />\r\n\r\n<img class=\"aligncenter wp-image-8146 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-18-595x397.png\" alt=\"tủ đầu giường 18\" width=\"595\" height=\"397\" />\r\n\r\nBên dưới chân tủ có gắn nút nhựa, giúp dễ dàng di chuyển\r\n\r\n<img class=\"aligncenter wp-image-7887 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-15-595x446.png\" alt=\"tủ đầu giường 15\" width=\"595\" height=\"446\" />\r\n\r\nThiết kế hiện đại, sang trọng\r\n\r\n&nbsp;\r\n<h4>Mời Bạn cùng xem qua một số HÌNH ẢNH THỰC TẾ của PLUS tại nhà Khách hàng:</h4>\r\n<img class=\"aligncenter wp-image-7881 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-9-595x446.png\" alt=\"tủ đầu giường 9\" width=\"595\" height=\"446\" />\r\n\r\nTủ đầu giường PLUS tại nhà anh Tùng, chung cư ESTELLA HEIGHTS, P. An Phú, Q. 2\r\n\r\n<img class=\"aligncenter wp-image-7890 size-large\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/02/tu-dau-giuong-14-1-595x446.png\" alt=\"tủ đầu giường 14\" width=\"595\" height=\"446\" />', 'Tủ Đầu Giường MONA PLUS', 'TỦ ĐẦU GIƯỜNG HÀN QUỐC PLUS\r\n\r\nMàu sắc: màu antique sang trọng\r\n\r\nChất liệu: gỗ tự nhiên, cao su loại 1\r\n\r\nKích thước: D400 * R500 * C550\r\n\r\nThiết kế: theo phong cách hiện đại – sang trọng\r\n\r\nKiểu dáng vuông vắn, góc cạnh được vuốt mịn hiện đại và sang trọng, an toàn hơn khi sử dụng\r\n\r\nTủ có 2 ngăn, giúp không gian lưu trữ đồ dùng tiện ích\r\n\r\nBề mặt gỗ của tủ đầu giường PLUS đã được xử lý không thấm nước.\r\n\r\nSản phẩm đang bán tại: Hàn Quốc, Việt Nam\r\n\r\nThương hiệu: Han’s Furniture\r\n\r\nBảo hành: 1 năm (về kết cấu SP)\r\n\r\n<em>Lưu ý: Sản phẩm thực tế có thể giống hoặc đẹp hơn trên hình.</em>', 'publish', 'open', 'closed', '', 'tu-dau-giuong-mona-plus', '', '', '2021-01-08 14:44:00', '2021-01-08 14:44:00', '', 0, 'http://localhost/wordpress/?post_type=product&#038;p=63', 0, 'product', '', 0),
