(70, 1, '2021-01-08 15:06:45', '2021-01-08 15:06:45', 'Giường ngủ phong cách Hàn Quốc\r\n\r\nĐộ cao giường phù hợp, tạo cảm giác vững chắc, an toàn khi bước xuống giường.\r\n\r\nMàu walnut\r\n\r\n<img class=\"aligncenter\" src=\"https://hansfurniture.vn/wp-content/uploads/2018/08/UP-1-1.jpg\" />\r\n\r\n<img class=\"aligncenter\" src=\"https://hansfurniture.vn/wp-content/uploads/2018/08/UP-2-3-CH%E1%BB%A8NG-NH%E1%BA%ACN-CH%E1%BA%A4T-L%C6%AF%E1%BB%A2NG-SP-HANS-1.jpg\" width=\"853\" height=\"2333\" />\r\n<h1>GIƯỜNG HÀN QUỐC MONA VERA</h1>\r\n<img class=\"aligncenter size-large wp-image-9866\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-1-595x461.png\" alt=\"giường han quốc mona vera 1\" width=\"595\" height=\"461\" />\r\n\r\nKích thước:\r\n\r\nD2100 x R1200 x C250 mm\r\n\r\nD2100 x R1600 x C250 mm\r\n\r\nD2100 x R1800 x C250 mm\r\n\r\n<img class=\"aligncenter size-large wp-image-9875\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-10-595x469.png\" alt=\"giường han quốc mona vera 10\" width=\"595\" height=\"469\" />\r\n\r\n100% gỗ tự nhiên, cao su loại 1\r\n\r\n<img class=\"aligncenter size-large wp-image-9879\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-14-595x345.png\" alt=\"giường han quốc mona vera 14\" width=\"595\" height=\"345\" />\r\n\r\nMàu walnut trầm ấm\r\n\r\n<img class=\"aligncenter size-large wp-image-9869\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-4-595x381.png\" alt=\"giường han quốc mona vera 4\" width=\"595\" height=\"381\" />\r\n\r\nChân giường chắc chắn\r\n\r\n<img class=\"aligncenter size-large wp-image-9872\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-7-595x504.png\" alt=\"giường han quốc mona vera 7\" width=\"595\" height=\"504\" />\r\n\r\nNhững đường nét đơn giản, sang trọng\r\n\r\n<img class=\"aligncenter size-large wp-image-9868\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-3-595x428.png\" alt=\"giường han quốc mona vera 3\" width=\"595\" height=\"428\" />\r\n\r\nGóc cạnh giường ngủ được bo tròn, với thiết kế góc cạnh được bo tròn nhẹ nhàng, cho bạn cảm giác an toàn khi sử dụng\r\n\r\n<img class=\"aligncenter size-large wp-image-9871\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-6-595x438.png\" alt=\"giường han quốc mona vera 6\" width=\"595\" height=\"438\" />\r\n\r\nTạo không gian phòng ngủ ấm áp\r\n\r\n<img class=\"aligncenter size-large wp-image-9880\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-15-595x448.png\" alt=\"giường han quốc mona vera 15\" width=\"595\" height=\"448\" />\r\n\r\n<img class=\"aligncenter size-large wp-image-9873\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-8-595x486.png\" alt=\"giường han quốc mona vera 8\" width=\"595\" height=\"486\" />\r\n\r\nGiường Hàn Quốc MONA VERA 1m6 kết hợp 1m2\r\n\r\n<img class=\"aligncenter size-large wp-image-9870\" src=\"https://hansfurniture.vn/wp-content/uploads/2021/01/giuong-han-quoc-mona-vera-5-595x408.png\" alt=\"giường han quốc mona vera 5\" width=\"595\" height=\"408\" />\r\n\r\nMang đến cho bạn giấc ngủ thoải mái và ổn định hơn\r\n\r\nGiường ngủ Hàn Quốc với phong cách tối giản, phù hợp với mọi phong cách nội thất\r\n\r\n&nbsp;\r\n\r\n<img class=\"aligncenter\" src=\"https://hansfurniture.vn/wp-content/uploads/2019/04/dac-tinh-go-tu-nhien-hansfurniture.-595x1003.png\" alt=\"dac tinh go tu nhien-hansfurniture.\" />', 'Giường Hàn Quốc MONA VERA', 'Giường ngủ Hàn Quốc MONA VERA\r\n\r\nMàu gỗ: Nâu (Walnut)\r\n\r\nChất liệu: 100% gỗ tự nhiên, cao su loại 1\r\n\r\nKích thước: D2100 x R1600 x C250 (mm)\r\n\r\nGiường MONA VERA có nhiều kích thước:\r\n\r\nD2100 x R1200 x C250  giá: 4.900.000 đ\r\n\r\nD2100 x R1600 x C250 giá: 5.600.000 đ\r\n\r\nD2100 x R1800 x C250 giá: 6.200.000 đ\r\n\r\nĐộ cao giường ngủ phù hợp, tạo cảm giác vững chắc, an toàn khi bước xuống giường.\r\n\r\nGóc cạnh giường được bo tròn, an toàn cho trẻ nhỏ.\r\n\r\nBề mặt gỗ của giường đã được xử lý không thấm nước.\r\n\r\nSản phẩm đang bán tại: Hàn Quốc, Việt Nam\r\n\r\nThương hiệu: Han’s Furniture\r\n\r\nBảo hành: 1 năm (về kết cấu SP)\r\n\r\n<em>Lưu ý: Sản phẩm thực tế có thể giống hoặc đẹp hơn trên hình.</em>', 'publish', 'open', 'closed', '', 'giuong-han-quoc-mona-vera-br', '', '', '2021-01-09 01:40:54', '2021-01-09 01:40:54', '', 0, 'http://localhost/wordpress/?post_type=product&#038;p=70', 0, 'product', '', 0),
