(79, 1, '2021-01-08 15:12:58', '2021-01-08 15:12:58', '<h1>BÀN HỌC LEO 1200</h1>\r\n<h1><img class=\"aligncenter size-large wp-image-9823\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-4-595x441.png\" alt=\"bàn học hàn quốc leo 4\" width=\"595\" height=\"441\" /></h1>\r\nKích thước bàn: D1200 x R600 x C750 mm\r\nD1500 x R600 x C750 mm\r\n<h1><img class=\"aligncenter size-large wp-image-9822\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-3-595x593.png\" alt=\"bàn học hàn quốc leo 3\" width=\"595\" height=\"593\" /></h1>\r\nBàn có 2 ngăn kéo tiện dụng\r\n<h1><img class=\"aligncenter size-large wp-image-9824\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-5-595x442.png\" alt=\"bàn học hàn quốc leo 5\" width=\"595\" height=\"442\" /></h1>\r\n100% gỗ tự nhiên, cao su loại 1\r\n<h1><img class=\"aligncenter size-large wp-image-9819\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-9-595x441.png\" alt=\"bàn học hàn quốc leo 9\" width=\"595\" height=\"441\" /></h1>\r\nMặt bàn nhẵn mịn, không thấm nước\r\n<h1><img class=\"aligncenter size-large wp-image-9816\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-6-595x443.png\" alt=\"bàn học hàn quốc leo 6\" width=\"595\" height=\"443\" /></h1>\r\n&nbsp;\r\n<h1><img class=\"aligncenter size-large wp-image-9818\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-8-595x443.png\" alt=\"bàn học hàn quốc leo 8\" width=\"595\" height=\"443\" /></h1>\r\nGóc cạnh bàn được xử lý bo, an toàn khi sử dụng\r\n\r\n<img class=\"aligncenter size-large wp-image-9821\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-2-595x596.png\" alt=\"bàn học hàn quốc leo 2\" width=\"595\" height=\"596\" />Có thể kế hợp nhiều loại ghế khác nhau\r\n\r\n<img class=\"aligncenter size-large wp-image-9826\" src=\"https://hansfurniture.vn/wp-content/uploads/2020/12/ban-hoc-han-quoc-leo-10-595x596.png\" alt=\"bàn học hàn quốc leo 10\" width=\"595\" height=\"596\" />', 'Bàn Học LEO 1200', 'Tên Sản Phẩm: Bàn Học Hàn Quốc LEO\r\n\r\nMàu: Tự Nhiên, Walnut\r\n\r\nKích thước: D1200 x R600 x C750 (mm): 4.300.000 VND\r\nD1500 x R600 x C750 (mm): 5.100.000 VND\r\n\r\nChất liệu: 100% gỗ tự nhiên, cao su loại 1.\r\n\r\nSản phẩm đang bán tại: Hàn Quốc, Việt Nam\r\n\r\nThương hiệu: Han’s Furniture\r\n\r\nBảo hành: 1 năm (kết cấu sản phẩm)', 'publish', 'open', 'closed', '', 'ban-hoc-leo-1200', '', '', '2021-01-08 15:12:59', '2021-01-08 15:12:59', '', 0, 'http://localhost/wordpress/?post_type=product&#038;p=79', 0, 'product', '', 0),
